import React from 'react';
import Main_nav_item_left from "./main_nav_item_left.jsx";
import Main_nav_item_rigth from "./inner_nav_item_rigth";
import "./header.css";
import "./inner_nav_item_rigth.css";
import {
    Link
} from "react-router-dom";

class Header extends React.Component{
    render() {
        return(
            <header className={"container-fluid text-align-center"} id={"top-bar"}>
                <div id={"first_row_left"}>
                    <Link to="/"><img className={"logo_img"} src={"././images/realtor.png"} alt={"/"}/></Link>
                    <Main_nav_item_left/>
                </div>
                <div>
                    <Main_nav_item_rigth/>
                </div>
            </header>
        )
    }
}

export default Header;
